settings.cardCss:
.card {
    position: relative;
    padding: 0;
    width: 100%;
    height: 100%;
}

.card .content {
    height: 100%;
}

.card .upper-bar {
    position: relative;
    z-index: 0;
    overflow: hidden;
    height: 100%;
    box-shadow: 0 1px 3px 0 rgba(0, 0, 0, .26);
    color: #fff;
}

.card .lower-bar {
    height: 35%;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-around;
    flex-wrap: wrap;
    margin-left: 30px;

}

.card .lower-bar .element {
    display: flex;
    flex-direction: row;
    width: 33.33%;

}

.card .right-top-bar {
    position: absolute;
    top: 10px;
    right: 10px;
    display: flex;
    flex-direction: row;
    align-items: center;
}

.card .right-top-bar .icon-container {
    display: none;
    box-shadow: 0px 0px 4px 2px rgba(255, 255, 255, .26);
    cursor: pointer;
    border: 3px solid #fff;
    color: #fff;
    background-color: rgb(0, 0, 0);
}

.card .right-top-bar .icon-container .icon {
    color: #fff;
}

.card .right-top-bar .icon-container:hover {
    border: 3px solid rgb(255, 157, 12);
    color: rgb(255, 157, 12);
    background-color: #fff;
}

.card .right-top-bar .icon-container:hover .icon {
    color: rgb(255, 157, 12);
}

.card .image-shade {
    width: 100%;
    height: 100%;
    padding-left: 16px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    background-color: rgba(0, 0, 0, .1);
    z-index: 0;
}

.card h1 {
    margin: 0;
    font-size: 20px;
    font-weight: bold;
    line-height: 30px;
}

.card .icon-container {
    height: 30px;
    width: 30px;
    border-radius: 50%;
    border: 3px solid rgb(60, 179, 113);
    text-align: center;

}

.card .description {
    margin-left: 10px;
    font-size: 20px;
    font-weight: 500;
    color: rgb(60, 179, 113);
    display: flex;
    align-items: center;
}

.card .value {
    font-size: 40px;
    font-weight: 300;
    letter-spacing: -2px;
}

.card .icon {
    line-height: 30px;
    color: rgb(255, 157, 12);
}

.card video {
    position: absolute;
    top: 75%;
    left: 0;
    width: 160%;
    z-index: -1;
    transform: translateY(-70%);
}

.card .element {
    transition: background-color 0.5s ease;
}

.card .element:hover {
    border-radius: 4px;
    cursor: pointer;
    background-color: rgb(91, 91, 91);
}

